import styled from "styled-components";

const Father = styled.div`
  display: flex;
  gap: 10px;
`;
const Box1 = styled.div`
  background-color: teal;
  width: 100px;
  height: 100px;
`;
const Box2 = styled.div`
  background-color: tomato;
  width: 100px;
  height: 100px;
`;
const Text = styled.span`
  color: white;
  text-align: center;
  vertical-align: middle;
`;
function App() {
  return (
    <Father>
      <Box1>
        <Text>Hello</Text>
      </Box1>
      <Box2 />
    </Father>
  );
}

export default App;
